import { configureStore } from "@reduxjs/toolkit";
import { createApi } from "@reduxjs/toolkit/dist/query";

import { cryproApi } from "../services/cryptoApi";

export default configureStore({
    reducer: {
        [createApi.reducerPath]: createApi.reducer
    },
})
